```def substrings(a, b, n):
    """Return substrings of length n in both a and b"""
    # lo and lt store substrings of a and b
    l1 = a.split(' ')
    l2 = b.split(' ')
    lo = []
    lt = []
    # ll stores substrings of length n common in a and b
    ll = []
    # for substrings of l1
    for s in l1:
        if len(s) < n:
            continue
        if len(s) == n:
            lo.append(s)
        if len(s) > n:
            for j in range(len(s) - n + 1):
                lo.append(s[j:j+n])
    # for substrings of l2
    for s in l2:
        if len(s) < n:
            continue
        if len(s) == n:
            lt.append(s)

        if len(s) > n:
            for j in range(len(s) - n + 1):
                lt.append(s[j:j+n])

    for s in lo:
        if s in lt and s not in ll:
            ll.append(s)
    return ll```
